    desc: "rock sissor paper~~ ",
    link: "./rsp",
  },
  {
    card: 5,
    img: require("./images/dog.jpg"),
    title: "Image1",
  },
  {
    card: 6,
    img: require("./images/dog.jpg"),
    title: "Image1",
  },
];

export default tileData;
